const createSbakeNode = (x, y, direction = "left") => {
  const cord = { x, y };
  const dir = direction;
  return { cord, dir };
};

export class Snake {
  constructor(x, y) {
    
  }
  move(direction = "") {
    const { x, y } = this.head.val;
    switch (direction.toString().toLowerCase()) {
      case "up":
        return { x, y: y - 1 };
      case "down":
        return { x, y: y + 1 };
      case "left":
        return { x: x - 1, y };
      case "right":
        return { x: x + 1, y };
      default:
        return { x, y };
    }
  }

  grow() {}
}
